@kulfi.beauty is here to celebrate and center the narratives of South Asian culture. ✨

The beauty brand, known for its kajal eyeliner, uses Instagram to source important topics and conversations from the community in order create content and share stories that resonate. ❤️

“We want South Asians to cast off shackles of self-doubt and step into the protagonist roles of their own lives and bask in their achievements, their shared cultures and their individual stories,” says founder and CEO @priyankaganjoo. 👏👏👏
